package main

import "fmt"


func isPalindrome(rs string,step int) bool{

	size :=len(rs)
	for i:=0;i< size/2;i++{

		if rs[i]!=rs[size-i-1] {
			//fmt.Println(rs,step,i)
			if step>0{
				return false
			}else {
				//fmt.Println(rs[i+1:size-i-1],rs[i:size-i-2],i)
				return isPalindrome(rs[i+1:size-i],1)||isPalindrome(rs[i:size-i-1],1)

			}
		}

	}

	return true
}

func validPalindrome(s string) bool {

	return isPalindrome(s,0)

}
